  name: $('Incoming lead').first().json.name,
  email:$('Incoming lead').first().json.email, 

};

let outcome = "Duplicate"; // default

for (let key in incoming) {
  if (incoming[key] && incoming[key] !== existing[key]) {
    outcome = "Updated";
    break;
  }
}

return [{ json: { outcome } }];

